  TokenIntersect AlexPosn |
  TokenExcept AlexPosn    |
  TokenInsert AlexPosn    |
  TokenInto AlexPosn      |
  TokenValues AlexPosn    |
  TokenUpdate AlexPosn    |
  TokenSet AlexPosn       |
  TokenDelete AlexPosn    |
  TokenJoin AlexPosn      |
